  //       },
  //     });
  //     if (response.status === 200) {
  //       return true;
  //     }

  //   } catch (error) {
  //     console.error('Error:', error);
  //   }
  // }
  return (
    <div>
      <nav>
        <Link to="/">Home</Link> | <Link to="/create-accountss">Create Account</Link> | <Link to="/fetch-user-data">Fetch User Data</Link> | <Link to="/SignIn">Sign In</Link> | <Link to="/ProtectedPage">Protected Page</Link> |<Link to= "/FullCartView">Full Cart View</Link>
        <button onClick={handleLogout}>Logout</button>
      </nav>
      <Routes>
        <Route path="/" element={<h1>Welcome to the App</h1>} />
        <Route path="/fetch-user-data" element={<FetchUserData />} />
        <Route path="/create-accountss" element={<SignUp />} />
        <Route path="/SignIn" element={<SignIn />} />
        <Route path ="/FullCartView" element={<FullCartView />} />
        <Route 
          path="/ProtectedPage"
          element={
            <ProtectedPage isAuthenticated={isAuthenticated}>
              <h2>Protected Page</h2>
              <p>This page is protected and requires authentication to access.</p>
              <ProtectedPage />
            </ProtectedPage> 
          } />

      </Routes>
    </div>
  );
};
export default App;
